import './App.css';
import Header from './Header';

const arrayList = ['Acordar cedo', 'Fazer café', 'Programar', 'Chorar', 'Banho', 'Dormir!', 'Cagar', 'Comer'];

const Task = (value) => {
  return (
    <li>{value}</li>
  );
}

const listTask = () => {
  return (
    arrayList.map((tarefa) => {
      return Task(tarefa)})
  )
}


function App() {
  return (
    <ol>{listTask()}</ol>
  )
}

export default App;
